class Node:
    """
    node
    with coordinate on the map
    and the parent node
    
    parameters:
    x:      the x coordinate on map
    y:      the y coordiante on map
    parent: the parent node
    """
    def __init__(self, x, y):
        self.x = x
        self.y = y
        self.parent = None


class GlobalPlanner:
    def __init__(self):
        # TODO  : 
        #   tf listener : 
        #   publisher   : /course_agv/global_path
        #   subscriver  : /course_agv/goal
        #   service     : /course_agv/global_plan
        #   initialize for other variable
        
        """
        parameters:
        path.pub:       the publisher
        map_size:       the wideth of map (suppose it is square)
        coef:           the coefficient of map scaling,map_size/coor_size
        coor_size:      the size of coordinate, ranging in [-coor_size, coor_size]
        start:          the initial position of robot in map coordinate
        node_list:      the list of node that can be reached
        max_iter:       the maximum number of iteration
        max_dist:       the maximum distance of one move
        goal_radius:    the region that is close enough to the goal

        Note:
        the direction of map(tuple) and the map coordinate is different, x is column, y is row, therefore to find the point in the map(tuple), we need to use map[self.map_size*y + x]
        """ 
        self.path_pub = rospy.Publisher('/course_agv/global_path',Path,queue_size = 1)
        self.map_size = 129
        self.coef = 128.0/20
        self.coor_size = 10
        self.start = Node(64, 64)
        self.node_list = [self.start]
        self.max_iter = 5000
        self.max_dist = 15
        self.goal_radius = 5
