    """
    subscribe to the goal publisher and find path

    Arg:
        None

    Returns:
        None
    """
    def subscribe_goal(self):
        self.goal_sub = rospy.Subscriber(
                '/course_agv/goal',
                PoseStamped,
                self.callback,
                queue_size=1)  # subscribe the goal

    """
    callback function of subscriber, get the map and use the goal to find the path

    Arg:
        data(PoseStamped): the position of goal
    
    Returns:
        None
    """
    def callback(self, data):
        # obtain the coordinate of goal
        goal_x = data.pose.position.x
        goal_y = data.pose.position.y

        # turn the coordinate into the map coordinate
        self.goal = Node(int(self.coef*(goal_x+self.coor_size)), int(self.coef*(goal_y+self.coor_size)))
        print("start node x:{} y:{}".format(self.start.x, self.start.y))
        print("goal node x:{} y:{}".format(self.goal.x, self.goal.y))

        # obtain the map(tuple)
        self.map = self.get_map()

        # clear cache
        self.node_list = [self.start]

        # if there is no obstacle between start and goal, no need to plan
        if self.check_line(self.start, self.goal) == 0:
            path = self.go_direct(self.start, self.goal)
        # use rrt to find path
        else:
            path = self.plan_path()

        # publish the path
        self.path_pub.publish(path)

